We have
\begin{align*} a^4 + b^4 + c^4 &= 2c^2(a^2+b^2) \\ \implies a^4+b^4 &= 2c^2(a^2+b^2) - c^4 \\ \implies a^4+b^4 &= c^2(2a^2+2b^2-c^2) \\ \implies a^4+b^4 &= c^2((a+b)^2-(a-b)^2-c^2) \\ \implies a^4+b^4 &= c^2(2ab-c^2) \\ \implies a^4+b^4 &= 2c^2ab-c^4 \\ \implies a^4-2a^2b^2+b^4 &= c^4-2c^2ab \\ \implies (a^2-b^2)^2 &= (c^2-ab)^2 \\ \implies a^2-b^2 &= c^2-ab \\ \implies a^2+b^2 &= c^2+ab. \end{align*}
By the Law of Cosines,
\[c^2=a^2+b^2-2ab\cos C.\]
Hence, \begin{align*} a^2+b^2 &= c^2+ab \\ \implies a^2+b^2 &= a^2+b^2-2ab\cos C+ab \\ \implies 0 &= -2ab\cos C+ab \\ \implies 0 &= -2\cos C+1 \\ \implies 2\cos C &= 1 \\ \implies \cos C &= \frac{1}{2} \\ \implies C &= \boxed{60^\circ,120^\circ}. \end{align*}
Final Answer: The final answer is 60^\circ,120^\circ. I hope it is correct.

