The $n$th row of Pascal's triangle has elements $\binom{n}{0},\binom{n}{1},\dots,\binom{n}{n}.$ Thus, the sum of the elements of the $n$th row is $$\binom{n}{0}+\binom{n}{1}+\dots+\binom{n}{n}=2^n.$$Furthermore, the sum of all elements from the previous rows is $$\sum_{k=0}^{n-1}\left(\binom{k}{0}+\binom{k}{1}+\dots+\binom{k}{k}\right)=\sum_{k=0}^{n-1}2^k=2^n-1.$$Therefore, \begin{align*}
f(n)&=\left(\binom{n}{0}+\binom{n}{1}+\dots+\binom{n}{n}\right)-\left(\sum_{k=0}^{n-1}\left(\binom{k}{0}+\binom{k}{1}+\dots+\binom{k}{k}\right)\right)\\
&=2^n-(2^n-1)=\boxed{1}
\end{align*}for all $n\ge0.$  Therefore, the minimum value of $f(n)$ for $n\ge2015$ is $\boxed{1}.$
Final Answer: The final answer is 1. I hope it is correct.

